    "2015-01-22T15:57:54.147984",nt"name": "neighborhood-stabilization-program-data-nsp1-statewide",nt"isopen":
    false,nt"url": null,nt"notes": "HUD's Neighborhood Stabilization Program
    (www.HUD.gov/nsp) provides emergency assistance to state and local governments to
    acquire and redevelop foreclosed properties that might otherwise become sources
    of abandonment and blight within their communities. The Neighborhood Stabilization
    Program (NSP) provides grants to every state, certain local communities, and other
    organizations to purchase foreclosed or abandoned homes and to rehabilitate, resell,
    or redevelop these homes in order to stabilize neighborhoods and stem the decline
    of house values of neighboring homes. The program is authorized under Title III
    of the Housing and Economic Recovery Act of 2008.",nt"license_title": "License
